import collections

def threeSum(nums):
    # necessary for deduplication
    nums.sort()

    cols = collections.defaultdict(list)
    for a_i, a in enumerate(nums):
        cols[a].append(a_i)

    output = set()
    for a_i, a in enumerate(nums):
        # output only sorted (a_i, b_i)
        for b_i, b in enumerate(nums[a_i+1:]):
            # offset
            b_i += a_i+1

            output_local = (a, b, -(a+b))
            if output_local in output:
                continue
            if -(a + b) in cols:
                last_good_index = cols[-(a+b)][-1]
                if last_good_index <= b_i:
                    continue
                output.add(output_local)
    return [list(x) for x in output]

print(threeSum([-1,0,1,2,-1,-4,]))
